-- ----------------------------
-- Procedure structure for assign_codes
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_codes`;
delimiter ;;
CREATE PROCEDURE `assign_codes`()
BEGIN

		DECLARE v_code VARCHAR(20);
    DECLARE v_pcode VARCHAR(20);
    DECLARE v_depth INT;
    DECLARE pcode_cursor CURSOR FOR SELECT pcode FROM sys_dept;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET @done = TRUE;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '42S22' SET @done = TRUE;

    OPEN pcode_cursor;
    pcode_loop: LOOP
        FETCH pcode_cursor INTO v_pcode;
        IF  @done THEN
            LEAVE pcode_loop;
        END IF;


        UPDATE sys_dept SET code = CONCAT(SUBSTRING(pcode, INSTR(pcode, '_') + 1), '__', LPAD(SUBSTRING(pcode, INSTR(pcode, '_') + 1), 3, '0')), pcode = SUBSTRING(pcode, INSTR(pcode, '_') + 1) WHERE parent_id = v_pcode AND LENGTH(code) = 0;
    END LOOP;
    CLOSE pcode_cursor;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for deleteCustomTable
-- ----------------------------
DROP PROCEDURE IF EXISTS `deleteCustomTable`;
delimiter ;;
CREATE PROCEDURE `deleteCustomTable`()
BEGIN

	delete from form where  custom=true;
	delete from form_field where form_id not in (select id from form);
	delete from sys_resources where form_id not in (select id from form);
	delete from sys_group_resources where sys_resources_id not in (select id from sys_resources);
	delete  from sys_menu where form_id is not null and form_id not in (select id from form);
	delete from sys_group_resources where sys_menu_id!=null and sys_menu_id not in (select id from sys_menu);

END
;;
delimiter ;

