delimiter ;;
CREATE PROCEDURE `set_dept_code`()
BEGIN DECLARE count INT DEFAULT 0; DECLARE parent_code VARCHAR(50); DECLARE dept_id VARCHAR(50); DECLARE dept_name VARCHAR(50); DECLARE code VARCHAR(50); DECLARE pcode VARCHAR(50);

SELECT COUNT(*) INTO count FROM sys_dept;

IF count > 0 THEN
    UPDATE sys_dept SET code = '001', pcode = NULL WHERE parent_id IS NULL;



END IF;
END
;;
